def print_matrix_spiral(M):

    if M.shape[0] <= M.shape[1] :
        road = 2 * len(M) - 1
    elif M.shape[0] > M.shape[1]:
        road = 2 * len(M[0])
    loop = (road // 4) + 1    # This is the total number of 360 degree turns towards inside. Test it with 7x6 matrix first. you will see you will be covering 3 times 360 degree turns, and 12 times slicing.
    result = []
    i, j = 0, 0
    r,c = M.shape[0], M.shape[1]
    initial_row_count = M.shape[0]
    initial_col_count = M.shape[1]

    for k in range(loop):       # I know I am not using k in the following code in a loop range etc :)

        # SLICE TOWARDS EAST
        if  r >= 2 and c >=2:
            L = M[i, :]
            result = result + list(L)
            M = M[i+1:, :]
            r,c = M.shape[0], M.shape[1]
            j = j + len(L) - 1
        # SLICE TOWARDS SOUTH
        if  r >= 2 and c >=2:
            L = M[:, j]
            result = result + list(L)
            M = M[:, :j]
            r,c = M.shape[0], M.shape[1]
            i = i + len(L) - 1
            j = j - 1
        # SLICE TOWARDS WEST
        if  r >= 2 and c >=2:
            L = M[i, :][::-1]
            result = result + list(L)
            M = M[:i, :]
            r,c = M.shape[0], M.shape[1]
            i = i - 1
            j = j - (len(L) - 1)
        # SLICE TOWARDS NORTH
        if  r >= 2 and c >=2:
            L = M[:,j][::-1]
            result = result + list(L)
            M = M[:, j+1:]
            r,c = M.shape[0], M.shape[1]
            i = i - (len(L) - 1)
        # When Matrix dimension left less than 2x2, we need to slice all the rest in one go which is better.
        # Finally we need to break after this last slicing stage.
        if c < 2 and initial_col_count %2 == 0:
            L = M[:, j][::-1]
            result = result + list(L)
            break
        elif c < 2 and initial_col_count %2 == 1:
            L = M[:, j]
            result = result + list(L)
            break

        if r < 2 and initial_row_count %2 == 0:
            L = M[i, :][::-1]
            result = result + list(L)
            break
        elif r < 2 and initial_row_count %2 == 1:
            L = M[i, :]
            result = result + list(L)
            break
    print(result)
    # return result

print_matrix_spiral(M)

